import { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { toast } from 'react-toastify';
import { useDispatch } from 'react-redux';
import { increment } from '../features/memberslice';

function Register2(){
    const [batch, setBatch] = useState('');
    const [address, setAddress] = useState('');
    const [course, setCourse] = useState('');
    const [jobRole, setJobRole] = useState('');
    const [dob, setDob] = useState('');
    const [experienceLevel, setExperienceLevel] = useState('');
    const [gender, setGender] = useState('');
    const [placementStatus, setPlacementStatus] = useState('');
    const [companyName, setCompanyName] = useState('');

    const navigate = useNavigate();
    const dispatch = useDispatch();

    const onRegister2 = async () => {
        if (firstName.length === 0) {
          toast.error('please enter first name');
        } else if (lastName.length === 0) {
          toast.error('please enter last name');
        } else if (email.length === 0) {
          toast.error('please enter email');
        } else if (password.length === 0) {
          toast.error('please enter password');
        } else if (confirmPassword.length === 0) {
          toast.error('please confirm the password');
        } else if (password !== confirmPassword) {
          toast.error('password does not match');
        } else if (contact.length === 0) {
          toast.error('please enter Contact number');
        } else if (role.length === 0) {
          toast.error('please enter Contact number');
        }
        else {
          // Here we assume the register service is successful
          // const result = await register(firstName, lastName, email, password);
          // if (result['status'] === 'success') {
          dispatch(increment());
          toast.success('Successfully registered a new user');
          navigate('/login');
          // } else {
          //   toast.error(result['error']);
          // }
        }
      };

    return (
        <div>
      <h2 className='page-header'>Register</h2>
      <div className='row'>
        <div className='col'></div>
        <div className='col'>
          <div className='form'>
            <div className='mb-3'>
              <label htmlFor=''>Batch</label>
              <input
                onChange={(e) => setFirstName(e.target.value)}
                type='text'
                className='form-control'
              />
            </div>
            <div className='mb-3'>
              <label htmlFor=''>Last Name</label>
              <input
                onChange={(e) => setLastName(e.target.value)}
                type='text'
                className='form-control'
              />
            </div>
            <div className='mb-3'>
              <label htmlFor=''>Email</label>
              <input
                onChange={(e) => setEmail(e.target.value)}
                type='email'
                className='form-control'
              />
            </div>
            <div className='mb-3'>
              <label htmlFor=''>Password</label>
              <input
                onChange={(e) => setPassword(e.target.value)}
                type='password'
                className='form-control'
              />
            </div>
            <div className='mb-3'>
              <label htmlFor=''>Confirm Password</label>
              <input
                onChange={(e) => setConfirmPassword(e.target.value)}
                type='password'
                className='form-control'
              />
            </div>
            <div className='mb-3'>
              <label htmlFor=''>Contact</label>
              <input
                onChange={(e) => setContact(e.target.value)}
                type='number'
                className='form-control'
                pattern='\d{10}'
                title='Please enter a 10-digit phone number'
                placeholder='Enter 10-digit phone number'
              />
            </div>

            <div className='mb-3'>
              <label htmlFor='role'>Role</label>
              <div>
                <select
                  onChange={(e) => setRole(e.target.value)}
                  className='form-control selectpicker dropdown'
                  id='role'
                  value='Alumni' // Set default value to 'Alumni'
                  disabled // Disable the dropdown to prevent user changes
                >
                  <option value='Alumni'>Alumni</option>
                </select>
              </div>
            </div>

            <div className='mb-3'>
              <div>
                Already have an account? <Link to='/login'>Login here</Link>
              </div>
              <button onClick={onRegister2} className='btn btn-success mt-2'>
                Next
              </button>
            </div>
          </div>
        </div>
        <div className='col'></div>
      </div>
    </div>
    )
} 

export default Register2
